package main

import (
	"sort"
)

// Given an array of integers, sort the integers that are between 1 and 9 inclusive,
// reverse the resulting array, and then replace each digit by its corresponding name from
// "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine".
//
// For example:
// arr = [2, 1, 1, 4, 5, 8, 2, 3]
// -> sort arr -> [1, 1, 2, 2, 3, 4, 5, 8]
// -> reverse arr -> [8, 5, 4, 3, 2, 2, 1, 1]
// return ["Eight", "Five", "Four", "Three", "Two", "Two", "One", "One"]
//
// If the array is empty, return an empty array:
// arr = []
// return []
//
// If the array has any strange number ignore it:
// arr = [1, -1 , 55]
// -> sort arr -> [-1, 1, 55]
// -> reverse arr -> [55, 1, -1]
// return = ['One']
func ByLength(arr []int) []string {
	// Filter array to keep only integers between 1 and 9 inclusive
	var filtered []int
	for _, num := range arr {
		if num >= 1 && num <= 9 {
			filtered = append(filtered, num)
		}
	}

	// If no valid numbers, return empty slice
	if len(filtered) == 0 {
		return []string{}
	}

	// Sort the filtered array
	sort.Ints(filtered)

	// Reverse the sorted array
	for i, j := 0, len(filtered)-1; i < j; i, j = i+1, j-1 {
		filtered[i], filtered[j] = filtered[j], filtered[i]
	}

	// Map numbers to their string representations
	numToWord := map[int]string{
		1: "One",
		2: "Two",
		3: "Three",
		4: "Four",
		5: "Five",
		6: "Six",
		7: "Seven",
		8: "Eight",
		9: "Nine",
	}

	// Convert to string array
	result := make([]string, len(filtered))
	for i, num := range filtered {
		result[i] = numToWord[num]
	}

	return result
}
